static int lube_Autocycle_Session_Activate_fmt(EventParamType *params, int argc, char const **argv)
{
    struct Activate_params {
        bool continuous ;
        Count count ;
    } *pp = (struct Activate_params *)params ;
    int pnum = 0 ;
    if (sscanf(*argv++, "%"SCNi8, &pp->continuous) != 1) {
        return pnum ;
    } else {
        pnum++ ;
    }
    if (sscanf(*argv++, "%"SCNi32, &pp->count) != 1) {
        return pnum ;
    } else {
        pnum++ ;
    }
    return -1 ;
}
